  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113588 includes chemical,
  discrete sample, physical and profile data collected from OCEANUS in the North Atlantic
  Ocean from 1995-05-29 to 1995-06-03 and retrieved during cruise CARINA/32OC19950529.
  These data include DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  Potential temperature (theta), SALINITY and WATER TEMPERATURE. The instruments used
  to collect these data include CTD and bottle. These data were collected by Taro
  Takahashi of Columbia University; Lamont-Doherty Earth Observatory and R. Pickart
  [affiliation unknown] as part of the CARINA/32OC19950529 data set.nnThe CARINA (CARbon
  dioxide IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
